eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   faqItems: () => (/* binding */ faqItems)\n/* harmony export */ });\nconst faqItems = [\n    {\n        id: \"what-is-smc\",\n        question: \"Wat is Smart Money Concepts?\",\n        answer: \"Smart Money Concepts (SMC) is een trading methodologie die zich richt op het begrijpen van institutionele marktbewegingen. In plaats van traditionele technische analyse, leer je hoe 'smart money' (banken, hedge funds, institutionele traders) de markt be\\xefnvloedt en hoe je mee kunt profiteren van deze bewegingen door concepten zoals liquidity, order blocks, en fair value gaps te begrijpen.\"\n    },\n    {\n        id: \"suitable-for-whom\",\n        question: \"Voor wie is dit geschikt?\",\n        answer: \"Deze mentorship is geschikt voor zowel beginners als ervaren traders die willen leren over institutionele trading concepten. Je hebt geen voorkennis nodig, maar wel discipline, geduld en de bereidheid om tijd te investeren in leren en oefenen. Het is niet geschikt voor mensen die op zoek zijn naar 'quick wins' of gegarandeerde winsten.\"\n    },\n    {\n        id: \"profitable-after-month\",\n        question: \"Ben ik na \\xe9\\xe9n maand winstgevend?\",\n        answer: \"Er zijn geen garanties in trading. Het doel van de mentorship is om je de juiste kennis, tools en mindset te geven voor lange termijn succes. Sommige studenten zien resultaten binnen weken, anderen hebben maanden nodig. De focus ligt op het leren van een sustainable proces en risicobeheer, niet op snelle winsten.\"\n    },\n    {\n        id: \"recordings-available\",\n        question: \"Krijg ik opnames en terugkijkmogelijkheden?\",\n        answer: \"Ja, alle groepssessies en livestreams worden opgenomen en zijn beschikbaar voor terugkijken. Voor 1-op-1 sessies worden op verzoek ook opnames gemaakt. Je krijgt toegang tot een priv\\xe9 portal met alle materialen, opnames en resources.\"\n    },\n    {\n        id: \"broker-recommendations\",\n        question: \"Welke brokers of exchanges raad je aan?\",\n        answer: \"Ik geef geen specifieke broker aanbevelingen omdat dit persoonlijk is en afhankelijk van je locatie, kapitaal en voorkeuren. Wel leer je hoe je zelf brokers kunt evalueren op factoren zoals spreads, regulatie, betrouwbaarheid en platforms. Altijd je eigen onderzoek doen is essentieel.\"\n    },\n    {\n        id: \"time-commitment\",\n        question: \"Hoeveel tijd moet ik per week investeren?\",\n        answer: \"Voor optimale resultaten adviseer ik minimaal 5-10 uur per week: sessies bijwonen, huiswerk maken, chart analyse oefenen en journaling. Hoe meer tijd je investeert, hoe sneller je vooruitgang zult zien. Kwaliteit is belangrijker dan kwantiteit.\"\n    },\n    {\n        id: \"schedule-intake\",\n        question: \"Hoe plan ik een intake gesprek?\",\n        answer: \"Klik op 'Plan een intake' en je wordt doorgeleid naar mijn Calendly pagina waar je een gratis 15-minuten kennismakingsgesprek kunt inplannen. We bespreken je doelen, ervaring en of de mentorship bij je past. Geen verplichtingen, alleen een open gesprek over je trading ambities.\"\n    },\n    {\n        id: \"financial-advice\",\n        question: \"Is dit financieel advies?\",\n        answer: \"Nee, dit is uitsluitend educatief. Alle content, sessies en materialen zijn bedoeld voor educatieve doeleinden. Ik geef geen financieel advies en ben geen geregistreerde financi\\xeble adviseur. Je bent zelf verantwoordelijk voor je trading beslissingen en eventuele verliezen.\"\n    },\n    {\n        id: \"group-size\",\n        question: \"Hoe groot zijn de groepen?\",\n        answer: \"Groepsmentorship groepen zijn bewust klein gehouden (maximaal 8-10 personen) om persoonlijke aandacht te garanderen. Dit zorgt ervoor dat iedereen vragen kan stellen en individuele feedback kan krijgen op trades en analyses.\"\n    },\n    {\n        id: \"refund-policy\",\n        question: \"Wat is het refund beleid?\",\n        answer: \"Ik bied een 7-dagen geld-terug-garantie voor alle programma's. Als je na de eerste week niet tevreden bent, krijg je je geld volledig terug. Dit geeft je de kans om te ervaren of de aanpak bij je past zonder financieel risico.\"\n    },\n    {\n        id: \"technical-requirements\",\n        question: \"Welke technische vereisten zijn er?\",\n        answer: \"Je hebt een computer of laptop nodig met stabiele internetverbinding voor video calls. Voor chart analyse kun je gratis platforms zoals TradingView gebruiken. Specifieke software aanbevelingen en setup hulp krijg je tijdens de eerste sessies.\"\n    },\n    {\n        id: \"support-availability\",\n        question: \"Wanneer ben je beschikbaar voor support?\",\n        answer: \"Voor 1-op-1 studenten ben ik beschikbaar voor DM support tijdens kantooruren (9:00-17:00 CET, maandag-vrijdag). Groepsmentorship studenten kunnen terecht in de community chat en tijdens groepssessies. Response tijd is meestal binnen 24 uur.\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/faq.ts\n");

